/** Returns a sub-path of this path up to {@code length} components. */
public FacetLabel subpath(final int length) {
  if (length >= this.length || length < 0) {
    return this;
  } else if (length == 0) {
    return EMPTY;
  } else {
    return new FacetLabel(this, length);
  }
}

